import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import Footer from "./Footer"
import Note from "./Note";
import notes from "./notes.js";

const App = () => {
return (
    ReactDOM.render(
    <>
    <Header />
    <Note
        title = {notes.title}
        content = {notes.content} 
    />
    <Footer />
    </>
    ,document.getElementById("root"))
);
}


export default App;
